import { sectionTitle } from '../general-styles.js';
const landingStyles = {
  reviewsHeader:{
    position: 'relative',
  },
  videoOverlay:{
    height: '100%',
    position: 'absolute',
    top: '0',
    backgroundColor: 'rgba(0, 0, 0, 0.42)',
    minHeight: '1px',
    width: '100%',
  },
  titleContainer:{
    ...sectionTitle
  }
}

export default landingStyles;
